import React from "react";
import ScrollCarousel from 'scroll-carousel-react';

export const CarouselItem = () => {

    const slides = [
        {
            "src": "../2019/Khartoum/forum1.6cce6ab7.jpg",
            "alt": "forum1"
        },
        {
            "src": "../2019/Khartoum/forum2.77028c90.png",
            "alt": "forum2"
        },
        {
            "src": "../2019/Khartoum/forum3.4c22e2b8.jpg",
            "alt": "forum3"
        }
    ]
    return (

        <>
        <h1>This is my component page</h1>
        <p>Now i am showing my creation scroll carousel</p>
        <ScrollCarousel
          autoplay
          autoplaySpeed={8}
          speed={7}
          onReady={() => console.log('I am ready')}
        >
          {Array.slides.map((item) => (
            <div key={item} className='bg-blue-300/20 border-2 border-blue-300/70 rounded h-36 w-48'>
              {item}
            </div>
          ))}
        </ScrollCarousel>
      </>
    );
};
